// component is just js function
function ExpenseItem() {
    // the first pair of <div> </div> is the root element
    // other elements should be in the root element
  return (
    <div>
      <div>Date</div>
      <div>
        <h2>Title</h2>
        <div>Amount</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
